import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <>
      <ul
        style={{
          listStyleType: "none",
          border: "5px solid",
          position: "fixed",
          color: "white",
          height: "750px",
          width: "250px",
          padding: "75px",
          display: "block",
        }}
      >
        <li>
          <NavLink
            key="hero"
            to="/"
            style={({ isActive }) => {
              return {
                color: isActive ? "gold" : "#108c43",
                textDecoration: "none",
                fontSize: "40px",
              };
            }}
          >
            Tristan D'Amours
          </NavLink>
        </li>
        <li>
          <NavLink
            key="about"
            to="/about"
            style={({ isActive }) => {
              return {
                color: isActive ? "gold" : "skyblue",
                textDecoration: "none",
                fontSize: "35px",
              };
            }}
          >
            About{" "}
          </NavLink>
        </li>
        <li>
          <NavLink
            key="publishedWork"
            to="/publishedwork"
            style={({ isActive }) => {
              return {
                color: isActive ? "gold" : "skyblue",
                textDecoration: "none",
                fontSize: "35px",
              };
            }}
          >
            Published Work{" "}
          </NavLink>
        </li>
        <li>
          <NavLink
            key="contact"
            to="/contact"
            style={({ isActive }) => {
              return {
                color: isActive ? "gold" : "skyblue",
                textDecoration: "none",
                fontSize: "35px",
              };
            }}
          >
            Contact{" "}
          </NavLink>
        </li>
      </ul>
    </>
  );
};

export default Nav;
